  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Arthur R. Marshall Loxahatchee NWR for the next
  15 years. This plan outlines the Refuge vision and purpose and describes how Arthur
  R. Marshall Loxahatchee NWR will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the Refuge, an overview of the CCP
  process, information about the Refuge environment, the management direction, and
  strategies for plan implementation. Key planning issues include: wildlife habitat
  management, Refuge protection, public use, and partnerships.\",\n\t\"license_title\":
